// src/Components/Partner/AddPartner.jsx
import React, { useState } from 'react';
import './AddPartner.css';

function AddPartner({ onClose, onCreatePartner }) {
  const [partnerName, setPartnerName] = useState('');
  const [dataEncryptionKey, setDataEncryptionKey] = useState('');
  const [filePassword, setFilePassword] = useState('');
  const [detectionSettings, setDetectionSettings] = useState({
    phoneNumber: true,
    icNumber: true,
    personCompanyName: true,
    email: true,
    addressGeographic: true,
    dateTime: true,
    ethnicityRaceNationality: true,
    creditCard: true,
  });

  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setDetectionSettings(prevSettings => ({
      ...prevSettings,
      [name]: checked,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!partnerName.trim()) {
      alert('Partner name is required!');
      return;
    }

    onCreatePartner({
      name: partnerName,
      dataEncryptionKey,
      filePassword,
      detectionSettings,
    });
  };

  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <div className="modal-header">
          <h2>Create partner profile</h2>
          <button className="close-button" onClick={onClose}>&times;</button>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="form-group profile-upload-section">
            <div className="profile-icon-placeholder">ðŸ‘¤</div>
            <div className="profile-input-group">
                <input
                    type="text"
                    placeholder="Input field"
                    value={partnerName}
                    onChange={(e) => setPartnerName(e.target.value)}
                    className="input-field"
                    required
                />
                <button type="button" className="upload-icon-button">Upload Icon</button>
            </div>
          </div>

          <h3>Detection</h3>
          <div className="detection-grid">
            <label className="checkbox-container">
              Phone Number
              <input
                type="checkbox"
                name="phoneNumber"
                checked={detectionSettings.phoneNumber}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              IC Number
              <input
                type="checkbox"
                name="icNumber"
                checked={detectionSettings.icNumber}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Person / Company Name
              <input
                type="checkbox"
                name="personCompanyName"
                checked={detectionSettings.personCompanyName}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Email
              <input
                type="checkbox"
                name="email"
                checked={detectionSettings.email}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Address / Geographic
              <input
                type="checkbox"
                name="addressGeographic"
                checked={detectionSettings.addressGeographic}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Date Time
              <input
                type="checkbox"
                name="dateTime"
                checked={detectionSettings.dateTime}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Ethnicity / Race / Nationality
              <input
                type="checkbox"
                name="ethnicityRaceNationality"
                checked={detectionSettings.ethnicityRaceNationality}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
            <label className="checkbox-container">
              Credit Card
              <input
                type="checkbox"
                name="creditCard"
                checked={detectionSettings.creditCard}
                onChange={handleCheckboxChange}
              />
              <span className="checkmark"></span>
            </label>
          </div>

          <h3>Secret Info</h3>
          <div className="form-group">
            <label htmlFor="dataEncryptionKey">Data Encryption Key</label>
            <input
              type="password"
              id="dataEncryptionKey"
              placeholder="Enter encryption key"
              value={dataEncryptionKey}
              onChange={(e) => setDataEncryptionKey(e.target.value)}
              className="input-field"
            />
          </div>
          <div className="form-group">
            <label htmlFor="filePassword">File password</label>
            <input
              type="password"
              id="filePassword"
              placeholder="Enter password"
              value={filePassword}
              onChange={(e) => setFilePassword(e.target.value)}
              className="input-field"
            />
          </div>

          <div className="modal-footer">
            <button type="submit" className="create-button">Create</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default AddPartner;
